import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      newTodo: 'test',
      todoList: [
        { id: 1, title: '第一个代办' }
      ],
    };
  }
  render() {
    let todos = this.state.todoList.map((item, index) => {
      return <li>{item.title}</li>
    })
    return (
      <div>
        <h1>待办事项</h1>
        <div className="inputWrapper">
          <input type="text" value={this.state.newTodo} />
          <ol>
            {todos}
          </ol>
        </div>
      </div>
    )
  }
}

export default App;
